INSERT INTO `exam_answer` VALUES (1,0,'Na frase, ocorre um erro de concordância\r\nnominal, pois a pluralização, de certas\r\npalavras, está incorreta.'),(2,0,'A utilização do “há’ está correta, mas o “a”\r\ndeveria apresentar o acento grave, ou seja, ser\r\ncraseado.'),(3,1,'A utilização do “a” está correta, mas o “há”\r\ndeveria ser substituído por “à”, pois só\r\nutilizamos “há” no sentido de haver/existir.'),(4,0,'A utilização do “há” e “a” está correta, pois\r\nambos apresentam regras de utilização\r\nreferentes ao tempo, em que, se encontra a\r\ninformação contida na frase.'),(5,0,'Na frase, não ocorre erro de concordância\r\nnominal, mas outros erros gramaticais podem\r\nser encontrados.'),(6,0,'O enunciado é formado por sete palavras e&nbsp;todas são consideradas vocábulos.'),(7,1,'O enunciado é formado por sete vocábulos\r\ndos quais apenas dois são considerados\r\npalavras.'),(8,0,'O enunciado é formado por sete vocábulos\r\ndos quais cinco são considerados palavras.'),(9,0,'O enunciado é formado por sete palavras\r\ndos quais apenas duas são consideradas\r\nvocábulos.'),(10,0,'Todas as alternativas anteriores são falsas.'),(26,1,'Somente a I está correta.'),(27,0,'I e II estão corretas.&nbsp;'),(28,0,'II e III estão corretas.&nbsp;'),(29,0,'I, II, III estão corretas.'),(30,0,'I, II, III estão incorretas.'),(31,0,'O verbo “imprimir” encontra-se, nas\r\nsentenças, no particípio e segundo a norma\r\nculta da Língua Portuguesa, somente a frase 2\r\nestá correta, pois “imprimido” não existe.'),(32,1,'O verbo “imprimir” encontra-se, nas\r\nsentenças, no infinitivo e segundo a norma\r\nculta da Língua Portuguesa, somente a frase 2\r\nestá correta, pois “imprimido” não existe.&nbsp;'),(33,0,'O verbo “imprimir” encontra-se, nas\r\nsentenças, no particípio e segundo a norma&nbsp;culta da Língua Portuguesa, ambas as frases\r\nestão corretas.'),(34,0,'O verbo “imprimir” encontra-se, nas\r\nsentenças, no infinitivo e segundo a norma\r\nculta da Língua Portuguesa, ambas as frases\r\nestão corretas.'),(35,0,'O verbo “imprimir” encontra-se, nas\r\nsentenças, no particípio e segundo a norma\r\nculta da Língua Portuguesa, somente a frase 2\r\nestá correta, pois a forma verbal “imprimido”\r\nnão existe. Mas, na oralidade; podemos\r\nutilizá-la.'),(36,0,'&nbsp;Paínhes (acentuação de hiatos).'),(37,0,'Poporitanés (oxítona).'),(38,0,'&nbsp;Sasábi (paroxítona).'),(39,1,'&nbsp;Pétani (proparoxítona).'),(40,0,'Tês (monossílabo tônico).'),(41,0,'Oração coordenada assindética.'),(42,0,'Oração coordenada sindética aditiva.'),(43,0,'Oração subordinada explicativa.'),(44,0,'Oração coordenada e subordinada.&nbsp;'),(45,1,'Oração subordinada adjetiva.'),(46,0,'Erro de regência verbal.'),(47,1,'Erro de regência nominal.'),(48,0,'Falta de concordância nominal.'),(49,0,'Falta de concordância verbal.'),(50,0,'Falta de concordância verbal.'),(51,0,'&nbsp;Monossílabos tônicos terminados em: a(s),\r\ne(s) e o(s)'),(52,0,'Oxítonos terminados em: a(s), e(s), o(s),\r\nem, ens.&nbsp;'),(53,1,'Paroxítonos terminados em: ditongos\r\ncrescentes seguidos ou não de s.'),(54,0,'Ditongos abertos em qualquer posição.'),(55,0,'I e u, seguidos ou não de s, tônicos em\r\nhiatos.'),(56,0,'&nbsp;Sílaba: é um conjunto de sons que pode ser\r\nemitido numa só expiração.'),(57,1,'&nbsp;Oração: Sempre que a frase, ou membro da\r\nfrase, apresentar sujeito.'),(58,0,'Hiato: sequência de duas vogais em sílabas\r\ndiferentes.'),(59,0,'Ditongo: vogal e semivogal pronunciadas\r\nnuma só sílaba.'),(60,0,'Período: Chamamos período à frase\r\nconstituída de uma ou mais orações.'),(61,0,'&nbsp;O trecho apresenta objeto direto e indireto.'),(62,0,'O Sujeito da primeira frase é oculto.'),(63,0,'O trecho contém adjunto adverbial de\r\nmodo.'),(64,1,'&nbsp;O sujeito da segunda frase é simples.'),(65,0,'O verbo “ver” no trecho da música é\r\ntransitivo direto.'),(66,0,'Aparentemente, não gosta muito de ler,\r\nvisto que, Mafalda surpreendeu-se ao ver o\r\npai lendo um livro grande.'),(67,0,'Tentava ler o dicionário, mas por ser muito\r\nextenso, desistiu.'),(68,0,'Queria consultar o dicionário para tirar\r\ndúvidas e não ler livros, como sua filha\r\npensava.'),(69,0,'A leitura do dicionário não o agradou, fato\r\nque decepcionou sua filha.'),(70,1,'Gosta muito de ler livros, mas Mafalda\r\nqueria que ele lhe desse mais atenção.'),(71,1,'Os textos abordam o mesmo tema, o\r\n“rolezinho”. Apontando-o como uma\r\nmanifestação natural e pacífica que pode\r\nocorrer em qualquer sociedade.'),(72,0,'Os textos apresentam visões diferentes dos\r\nencontros marcados por jovens em shoppings,\r\nmas defendem a existencia dos mesmos. Pois,\r\nsão manifestações culturais que devem\r\nacontecer em qualquer sociedade.'),(73,0,'&nbsp;Os textos tratam sobre a mesma temática,\r\nmas apresentam visões totalmente diferentes\r\nsobre os “rolezinhos”.&nbsp;'),(74,0,'&nbsp;Os textos abordam temas diferentes, a\r\núnica coisa que os aproximam é o fato dos\r\nautores utilizarem os “rolezinhos” para\r\nfortalecer a argumentação textual.'),(75,0,'Nenhuma das alternativas.&nbsp;'),(76,0,'Os três candidatos à presidência da\r\nrepública foram retratados, de acordo com\r\nsuas respectivas colocações nas pesquisas\r\neleitorais que antecederam as Eleições/2014.&nbsp;'),(77,0,'A charge apresenta uma relação de embate,\r\nvisível, entre Dilma e Aécio, pois Marina foi\r\ncolocada fora da disputa eleitoral.'),(78,0,'Representa-se na imagem, de forma\r\nhumorística, a posição assumida pela\r\ncandidata Marina Silva nas Eleições/2014.'),(79,1,'A charge pode ser relacionada a uma\r\nexpressão popular, utilizada em situações de\r\ndúvida ou incerteza.&nbsp;'),(80,0,'A charge foi um modo escolhido para\r\nexaltar a candidata Marina Silva, pois ela está\r\nem um patamar mais elevado do que seus\r\noponentes.&nbsp;'),(81,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Na charge, é visível a inquietação dos\r\npopulares contra um político que, em sua\r\nexpressão facial e em sua fala, ignora o\r\nprotesto.</span></div>'),(82,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Na charge, o humor da tira é ocasionado\r\npela existencia de um termo ambíguo na fala\r\nde algum personagem.</span></div>'),(83,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Percebe-se pelo contexto que o “sistema”,\r\ntratado no diálogo, é algo tecnológico,\r\npossivelmente, relacionado a computadores.</span></div>'),(84,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">As chamadas palavras de ordem, não são\r\nutilizadas pelos manifestantes retratados na\r\ncharge.</span></div>'),(85,0,'Nenhuma das anteriores.&nbsp;'),(86,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O humor da charge é ocasionado pela\r\nposição em que o homem está sentado,\r\nimitando seu cachorro.</span></div>'),(87,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Na charge é visível o companheirismo e\r\nfidelidade do cão para com o homem, fazendo\r\njus ao ditado popular.</span></div>'),(88,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A charge satiriza o fanatismo do ser\r\nhumano, com coisas fúteis, comparando o\r\nhomem a um cachorro.&nbsp;</span></div>'),(89,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O humor da charge deve-se ao fato do\r\nhomem estar assistindo o programa de tevê:\r\n“Big Brother Brasil”.&nbsp;</span></div>'),(90,0,'Nenhuma das anteriores.'),(91,1,'$2s$'),(92,0,'$3s$'),(93,0,'$4s$'),(94,0,'$5s$'),(95,0,'$6s$'),(96,0,'5,0$cal/°C$;&nbsp;10$cal/g$;&nbsp;0,50$cal/g°C$.'),(97,0,'10$cal/°C$;&nbsp;5,0&nbsp;cal/g$;&nbsp;1,0$cal/g°C$.'),(98,0,'4,0$cal/°C$;&nbsp;2,0$cal/g$;&nbsp;5,0$cal/g°C$.'),(99,0,'5,0$cal/°C$;&nbsp;0,50$cal/g$;&nbsp;10$cal/g°C$.'),(100,1,'10$cal/°C$;&nbsp;5,0$cal/g$;&nbsp;0,25$cal/g°C$.'),(101,0,'$60 Km/h$.'),(102,0,'$216 Km/h$.'),(103,0,'$180 Km/h$.'),(104,0,'$90 Km/h$.'),(105,1,'$16 Km/h$.'),(106,0,'nos gases.'),(107,0,'nos sólidos que não apresentam elétrons livres.'),(108,0,'no vácuo.'),(109,1,'nos sólidos em geral.'),(110,0,'&nbsp;nos cristais.'),(111,0,'a)'),(112,0,'b)'),(113,0,'c)'),(114,0,'d)'),(115,1,'e)'),(116,0,'Aminoácidos e monossacarídeos;'),(117,0,'Proteínas e aminoácidos;'),(118,0,'Ácidos nucléicos e vitaminas;'),(119,0,'<div>Ácidos graxos, glicerol e vitaminas,&nbsp;<span style=\"line-height: 1.42857;\">compostos altamente energéticos;</span></div>'),(120,1,'<div>Vitaminas e frutose, fonte de carboidratos e&nbsp;<span style=\"line-height: 1.42857;\">energia;</span></div>'),(121,0,'<div style=\"text-align: justify;\">O processo descrito configura o transporte&nbsp;<span style=\"line-height: 1.42857;\">ativo de solutos pela membrana, pouco&nbsp;</span><span style=\"line-height: 1.42857;\">importante para homeostasia;</span></div>'),(122,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O aspecto principal deste tipo de transporte\r\nde eletrólitos é a espontaneidade da reação, ou\r\nseja, não ocorre qualquer gasto de ATP;</span></div>'),(123,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Este processo é representativo da\r\npermeabilidade seletiva da membrana, sendo\r\ndifusão facilitada;</span></div>'),(124,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">As hemácias são incapazes de realizar este\r\nprocesso, pois são anucleadas;</span></div>'),(125,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Este evento representa o transporte ativo, onde\r\nocorre a passagem de eletrólitos pela membrana\r\ncom auxílio de ATP, contra o gradiente.</span></div>'),(126,0,'Parede celular composta de quitina.'),(127,0,'Complexo de Golgi.'),(128,0,'Membrana nuclear.'),(129,0,'Mitocôndrias.'),(130,1,'Cloroplastos.'),(131,0,'Autótrofos, autótrofos.'),(132,1,'Quimiossintetizantes, autótrofos.'),(133,0,'Heterótrofos, heterótrofos.'),(134,0,'Autótrofos, heterótrofos.'),(135,0,'Nenhuma das anteriores.'),(136,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O aumento do lucro na produção agrícola e\r\na concentração de capital por meio dos\r\nganhos com o tráfico.</span></div>'),(137,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A aceitação passiva, pelos africanos, da\r\ncondição de escravos e o controle absoluto da\r\ncirculação de mercadorias.</span></div>'),(138,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O desconhecimento pelos escravos das\r\nnovas terras, dificultando as fugas, e a maior\r\nespecialização da mão de obra.</span></div>'),(139,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A substituição da mão-de-obra indígena e a\r\nsemelhança com as relações de trabalho então\r\nexistentes a Europa.</span></div>'),(140,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O repovoamento de áreas cujas populações\r\noriginais foram dizimadas e o controle militar\r\ndo &nbsp;Atlântico.</span></div>'),(141,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Os incas foram derrotados porque\r\nacreditaram que os conquistadores eram\r\ndeuses de volta aos Andes e se sacrificaram\r\nem frente deles.</span></div>'),(142,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A conquista do vasto território inca foi se\r\nconsolidando sem resistência por parte dos\r\nindígenas, sobretudo dos quéchuas, que foram\r\nexterminados.</span></div>'),(143,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O aventureiro Fernão Cortez cruzou o\r\nPanamá, chegou ao Pacífico e comandou a\r\nconquista dos incas, aproveitando-se das lutas\r\ninternas que enfraqueciam o Império.</span></div>'),(144,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Atahualpa consultou os sacerdotes\r\nadivinhos para que explicassem a invasão dos\r\nconquistadores. Por não obter resposta, o rei\r\nos matou e dessa forma o Império teocrático\r\ncolapsou.</span></div>'),(145,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O conquistador espanhol, após ter tido\r\ncontato direto com Atahualpa, armou-lhe uma\r\ncilada e o fez prisioneiro; pediu resgate em\r\nouro, mas, mesmo assim, o matou. Sem o rei,\r\no Império desestabilizou-se e caiu.</span></div>'),(146,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O crescimento populacional, com\r\ndecorrente aumento do mercado consumidor\r\nde alimentos.</span></div>'),(147,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A oportunidade de fornecer alimentos para\r\nos participantes das cruzadas e para as áreas\r\npor eles conquistadas.</span></div>'),(148,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O fim das guerras e o estabelecimento de\r\nnovos padrões de relacionamento entre servos\r\ne senhores de terras.</span></div>'),(149,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A formação de associações de\r\nprofissionais, com decorrente\r\naperfeiçoamento da mão de obra rural.</span></div>'),(150,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O aprimoramento das técnicas de cultivo e\r\numa relação mais intensa entre cidade e\r\ncampo.</span></div>'),(151,0,'<div style=\"text-align: justify;\">Eleições diretas para presidente e\r\nelaboração de nova Constituição.<br></div>'),(152,0,'<div style=\"text-align: justify;\">Alternância política na Presidência e\r\nintensa radicalização ideológica.<br></div>'),(153,0,'<div style=\"text-align: justify;\">Supressão de direitos políticos dos\r\nadversários do regime e ampla liberdade de\r\nimprensa.<br></div>'),(154,1,'<div style=\"text-align: justify;\">Inexistência de mobilizações de massa e\r\nfragilidade do poder judiciário.<br></div>'),(155,0,'<div style=\"text-align: justify;\">Pluralidade de organização sindical e plena\r\nliberdade de organização partidária.<br></div>'),(156,0,'<div style=\"text-align: justify;\">criou o Poder Moderador de exclusividade\r\ndo Imperador, o que na prática significava\r\nconceder-lhe poderes quase absolutos.<br></div>'),(157,0,'<div style=\"text-align: justify;\">provocou a insatisfação em diversas\r\nprovíncias, estando na base da eclosão de\r\ndiversas rebeliões, como a Confederação do\r\nEquador, a Sabinada e o Contestado.<br></div>'),(158,0,'<div style=\"text-align: justify;\">favoreceu o reconhecimento do Brasil\r\ncomo nação independente, o que ocorreu sem\r\nreveses, à exceção dos Estados Unidos por\r\nconta da doutrina Monroe.<br></div>'),(159,0,'<div style=\"text-align: justify;\">estabeleceu a eleição pelo voto censitário\r\npara os governadores das províncias.<br></div>'),(160,1,'<div style=\"text-align: justify;\">determinou que representantes para o\r\nSenado e a Câmara seriam eleitos pelo voto\r\ndireto e secreto.<br></div>'),(161,1,'<div style=\"text-align: justify;\"><div>O fim da autonomia dos estados e o início&nbsp;<span style=\"line-height: 1.42857;\">de um período de centralização política, que&nbsp;</span><span style=\"line-height: 1.42857;\">caracterizou a República como uma ditadura.</span></div></div>'),(162,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">&nbsp;Uma perspectiva de democratização para a\r\nrecente República brasileira, impedindo que\r\nnovos protestos políticos e armados\r\nirrompessem.</span></div>'),(163,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A relação diplomática com os demais\r\npaíses sul-americanos e se dispunha a obter\r\nalianças e acordos comerciais no exterior.</span></div>'),(164,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Um pacto entre o governo federal e os\r\ngovernos estaduais, que teriam autonomia\r\neconômica, mas assegurariam apoio político\r\nao Presidente.</span></div>'),(165,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O modelo político adotado como capaz de\r\ndemocratizar o Brasil e de obter, sem lutas, a\r\nunidade política e territorial ainda inexistente.</span></div>'),(166,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Faziam parte do projeto republicano de\r\nremodelação urbanística da capital brasileira\r\npara destruir os vestígios físicos da\r\ncolonização portuguesa.</span></div>'),(167,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Eram parte do programa nacional de\r\nindustrialização, que pretendia transformar a\r\ncidade do Rio de Janeiro no maior pólo\r\nindustrial da América Latina.</span></div>'),(168,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Foram postas em prática sob a motivação\r\nde ideais higienistas e de modernização e\r\naformoseamento do espaço urbano,\r\ncaracterísticos daquele período.</span></div>'),(169,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Ocorreram graças às ações reivindicatórias\r\nda população mais pobre do Rio de Janeiro,\r\nque reclamava melhorias em suas condições\r\nde moradia e transporte.</span></div>'),(170,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Foram realizadas com o objetivo de fixar as\r\ncamadas populares na região central do Rio\r\nde Janeiro, impedindo que migrassem para as\r\náreas nobres da zona norte.</span></div>'),(171,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A sua criação, em 1953, foi o resultado de\r\numa ampla campanha de mobilização social\r\nque se caracterizou pelo slogan \"O petróleo é\r\nnosso\".</span></div>'),(172,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Atendeu aos interesses da UDN, maior\r\npartido de oposição a Getúlio, interessada em\r\nestatizar amplos setores de nossa economia.</span></div>'),(173,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Foi a forma encontrada por Getúlio de\r\natender aos interesses dos Estados Unidos, na\r\nmedida em que a exploração do petróleo\r\ncontinuaria a ser feita por empresas norteamericanas.</span></div>'),(174,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Buscou satisfazer setores nacionalistas do\r\nempresariado, ainda que a forma escolhida,\r\nmantendo a exploração em mãos estrangeiras,\r\ntenha frustrado esses mesmos setores.</span></div>'),(175,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Foi o resultado de uma tendência\r\ninternacional que teve no presidente do\r\nMéxico, Gustavo Diaz Ordaz, o pioneiro\r\nnesse processo, com a criação da PEMEX em\r\nassociação com a Shell.</span></div>'),(176,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A adoção de acordos e tratados\r\ninternacionais como a Política de Boa\r\nVizinhança Panamericana, assinada em Lima\r\n(Peru), entre países da América Latina e os\r\nEstados Unidos em 1941.</span></div>'),(177,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A entrada no Brasil na Segunda Grande\r\nGuerra com a participação da Força\r\nExpedicionária Brasileira (FEB) lutando ao\r\nlado das tropas norte-americanas na Itália, em\r\ncinco escalões durante 1944 e 1945.</span></div>'),(178,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A liberação de empréstimos de bancos dos\r\nEstados Unidos na construção de hidrelétricas\r\ne estatais como foi o caso da construção da\r\nUsina de Volta Redonda, durante o governo\r\nVargas.</span></div>'),(179,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A pressão dos Estados Unidos para manter\r\na ditadura varguista, após o fim da guerra,\r\ndiminuindo a influência dos setores da UDN e&nbsp;</span><span style=\"line-height: 1.42857;\">reafirmando o modelo de estrutura e ideologia\r\ndo governo de Vargas.</span></div>'),(180,1,'Nenhuma das alternativas.'),(181,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Uma percepção da variedade de crenças,\r\npassíveis de serem consideradas, pela Igreja\r\nCatólica, como heréticas.</span></div>'),(182,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Uma crítica à incapacidade da Igreja\r\nCatólica de combater e eliminar suas\r\ndissidências internas.</span></div>'),(183,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Um interesse de conhecer outras religiões e\r\nformas de culto, atitude estimulada, à época,\r\npela Igreja Católica.</span></div>'),(184,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Um apoio às iniciativas reformistas dos\r\nprotestantes, que defendiam a completa\r\nliberdade de opção religiosa</span></div>'),(185,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Uma perspectiva ateísta, baseada na sua\r\nexperiência familiar.</span></div>'),(186,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">formou-se uma civilização complementar\r\nislâmica, pois ambas tiveram um mesmo\r\nponto de partida.</span></div>'),(187,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">originou-se uma civilização menos\r\ncomplexa que a islâmica devido à\r\npredominância da cultura germânica.</span></div>'),(188,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">desenvolveu-se uma civilização que se\r\nbeneficiou tanto da herança greco-romana\r\nquanto da islâmica.</span></div>'),(189,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">cristalizou-se uma civilização marcada pela\r\nflexibilidade religiosa e tolerância cultural.</span></div>'),(190,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">criou-se uma civilização sem dinamismo,\r\nem virtude de sua dependência de Bizâncio e\r\ndo Islão.</span></div>'),(191,1,'as ideias integralistas dos nacionalistas.'),(192,0,'a doutrina social da hierarquia da Igreja\r\nCatólica.'),(193,0,'a propaganda oficial da política de Vargas.'),(194,0,'a desesperança típica do pós-guerra.'),(195,0,'a postura de engajamento e crítica social.'),(196,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">à transição da agência espacial americana\r\nNASA para empresa comercial voltada ao\r\npúblico civil.</span></div>'),(197,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">à popularização e democratização do uso\r\nda internet e de programas de sensoriamento\r\nremoto no Brasil.</span></div>'),(198,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">à expansão do uso de imagens de satélite\r\npara investigação de fenômenos em várias\r\nescalas</span></div>'),(199,0,'<div style=\"text-align: justify;\">à globalização, que possibilitou maior&nbsp;<span style=\"line-height: 1.42857;\">integração do espaço mundial pela rápida&nbsp;</span><span style=\"line-height: 1.42857;\">evolução das telecomunicações.</span></div>'),(200,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">aos vultosos investimentos brasileiros em\r\nprogramas de sensoriamento remoto voltados\r\npara o controle do território nacional.</span></div>'),(201,0,'08 e 09 de setembro.'),(202,1,'15 e 16 de setembro.'),(203,0,'22 e 23 de setembro.'),(204,0,'29 e 30 de setembro.'),(205,0,'06 e 07 de outubro.'),(206,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">os seres vivos procuram se adequar às\r\ncondições do espaço geográfico.</span></div>'),(207,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">a paisagem está cada vez mais\r\ncondicionada à ação do homem e à sua\r\ntécnica</span></div>'),(208,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">o homem permanece subordinado às leis\r\nfundamentais da natureza física.</span></div>'),(209,1,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">a paisagem sofre alterações provocadas\r\npela ação da água e das máquinas.&nbsp;</span></div>'),(210,0,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">o homem possui uma tendência a preservar\r\nseu patrimônio histórico-cultural.</span></div>'),(211,0,'Apenas I é verdadeira.'),(212,0,'Apenas III é verdadeira.'),(213,0,'Apenas I e II são verdadeiras.'),(214,1,'Apenas II e III são verdadeiras.'),(215,0,'Nenhuma das alternativas acima.'),(216,1,'16,10.'),(217,0,'15,40.'),(218,0,'14,70.'),(219,0,'16,80.'),(220,0,'17,50.'),(221,0,'$ (a - 2)^2$'),(222,0,'$(2a - 2)^2$'),(223,0,'$(2a + 2)^2$'),(224,0,'$(a – 4)^2$'),(225,1,'$(a + 2)^2$'),(226,0,'3'),(227,1,'12'),(228,0,'9'),(229,0,'24'),(230,0,'36'),(231,0,'38.000'),(232,1,'40.500'),(233,0,'41.000'),(234,0,'42.000'),(235,0,'48.000'),(236,0,'$10^{99}$'),(237,0,'$5\\cdot10^{99}$'),(238,0,'$50^{99}$'),(239,0,'$10^{50}$'),(240,1,'$5^{99}$'),(241,0,'$10^1$'),(242,0,'$10^2$'),(243,0,'$10^3$'),(244,0,'$10^4$'),(245,1,'$10^5$'),(246,0,'$\\sqrt{9}$'),(247,0,'9'),(248,0,'33'),(249,1,'$3,3333...$'),(250,0,'$\\sqrt{27}$'),(251,1,'$11^0 = 0$'),(252,0,'$a^0 = a$'),(253,0,'$a^1 = 1$'),(254,0,'$8^0 = 1$'),(255,0,'$2^{-3} = -8$'),(256,0,'<div>$8\\cdot 10^6$&nbsp;<span style=\"line-height: 1.42857;\">habitantes.</span></div>'),(257,0,'$8$ bilhões de habitantes<br>'),(258,0,'$8,5.109$ habitantes<br>'),(259,0,'$9\\cdot 10^9$ habitantes<br>'),(260,1,'$9$ milhões de habitantes<br>'),(261,0,'110°'),(262,0,'55°'),(263,0,'60°'),(264,0,'80°'),(265,1,'50°');
