INSERT INTO `exam_question` VALUES (1,51,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857; background-color: initial;\">Os aspectos ortográficos da Língua\r\nPortuguesa são fundamentais para a\r\nconcretização da Linguagem, visando a\r\nobtenção de uma comunicação eficiente.\r\nBusca-se por meio de uma ortografia correta;\r\nobter textos, sendo eles verbais ou não\r\nverbais, coesos e coerentes. Baseando-se\r\nnessa definição, observe a frase que segue e\r\nmarque a opção que considerar correta.</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857; background-color: initial;\"><br></span></div><div style=\"text-align: center;\"><i>“Há um ano aspirei fazer parte da família\r\nCATS e daqui a alguns dias concretizarei meu\r\nsonho”</i></div>',1),(2,51,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857; background-color: initial;\">Palavras e vocábulos são considerados, por\r\nmuitos alunos e professores, sinônimos. Mas,\r\nos estudos etimológicos apresentam\r\ndiferenças de sentido entre essas\r\nclassificações. Sendo assim, utilizando suas\r\ndefinições apreendidas, observe o enunciado e\r\nassinale a alternativa verdadeira:</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857; background-color: initial;\"><br></span></div><div style=\"text-align: center;\"><i>“Os alunos do CATS adoram estudar\r\nGramática”</i></div>',1),(6,51,'Observe os anúncios publicitários abaixo:<div><br></div><div style=\"text-align: center;\"><u>&nbsp;Imagem I:</u></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><br></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><span style=\"line-height: 1.42857; background-color: initial;\"><u>Imagem II:</u></span><br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"line-height: 1.42857; background-color: initial;\"><u><br></u></span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><u>Imagem III:</u><br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><u><br></u></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: justify;\">A respeito da utilização do acento grave, por\r\nmeio do processo da crase, assinale a\r\nalternativa que julgar correta:<br></div>',1),(7,51,'Sobre os verbos e suas formas nominais:\r\ngerúndio, infinitivo e particípio, leia as frases\r\nabaixo e marque a opção correta.<div><br></div><div><u>Frase 1</u>: <i>Eu já tinha imprimido o arquivo\r\nontem.\r\nFrase 2: O arquivo já estava impresso ontem.</i><br></div><div><u>Frase 2</u>:<i>&nbsp;O arquivo já estava impresso ontem.<br></i></div>',1),(8,51,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857; background-color: initial;\">A relação abaixo é formada por palavras\r\ninventadas. Observe atentamente cada uma\r\ndelas e, baseado no seu conhecimento sobre o\r\nsistema de regras de acentuação da Língua\r\nPortuguesa, marque a alternativa\r\n</span><b style=\"line-height: 1.42857; background-color: initial;\">INCORRETA</b><span style=\"line-height: 1.42857; background-color: initial;\">:</span></div>',1),(9,51,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857; background-color: initial;\">Sobre os períodos compostos e suas\r\nrelações de dependência ou independência,\r\nanalise a imagem abaixo.</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857; background-color: initial;\"><br></span></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"line-height: 1.42857; background-color: initial;\"><br></span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: justify;\">A primeira frase do anúncio: “Tenha o\r\ncurrículo que o mercado tanto deseja.”,\r\napresenta:<br></div>',1),(10,51,'Leia atentamente:<div><br><div style=\"text-align: center;\"><i>“A rivalidade durante as Eleições/2014,&nbsp;</i></div><div style=\"text-align: center;\"><i>principalmente, entre os candidatos que</i></div><div style=\"text-align: center;\"><i>&nbsp;disputaram o Palácio do Planalto: Dilma e</i></div><div style=\"text-align: center;\"><i>&nbsp;Aécio e seus respectivos partidos políticos,</i></div><div style=\"text-align: center;\"><i>&nbsp;provocaram mudanças políticas históricas na&nbsp;</i></div><div style=\"text-align: center;\"><i>democracia brasileira.”</i><br></div></div><div style=\"text-align: justify;\"><i><br></i></div><div style=\"text-align: justify;\">O período acima apresenta uma incorreção\r\ngramatical, pois há:</div>',1),(11,51,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O novo acordo ortográfico da Língua\r\nPortuguesa transformou o quadro de regras\r\ndos vocábulos oxítonos, paroxítonos e\r\nproparoxítonos, no que se refere à acentuação\r\ngráfica. Leia as afirmações abaixo e assinale a\r\nopção em que a regra exposta foi extinta do\r\nportuguês:</span></div>',1),(12,51,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Todos os elementos constituintes da\r\nLíngua portuguesa, desde os menores\r\nvocábulos até as mais complexas construções\r\nfrasais, são essenciais para a compreensão e\r\nutilização do idioma. Então, analise as\r\ncolocações abaixo e marque a opção<b>\r\nINCORRETA</b>.</span></div>',1),(13,51,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O trecho abaixo foi retirado da música\r\n“Beijinho no ombro” da cantora: Valesca\r\nPopozuda. Analise-o, pautando em seus\r\nconhecimentos apreendidos durante o Ensino\r\nMédio e aponte a alternativa </span><b style=\"line-height: 1.42857;\">INCORRETA</b><span style=\"line-height: 1.42857;\">.</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: center;\"><i>“Desejo a todas inimigas vida longa</i></div><div style=\"text-align: center;\"><i>Pra que elas vejam cada dia mais nossa</i></div><div style=\"text-align: center;\"><i>vitória. [...]”</i></div>',1),(14,51,'Observe a charge abaixo:<div><br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><br></div><div style=\"text-align: justify;\">Levando em consideração as características\r\npessoais da personagem, escolha a alternativa\r\ncorreta sobre o pai de Mafalda.&nbsp;<br></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\"><br></div>',1),(15,51,'Leia atentamente os textos abaixo:<div><br></div><div style=\"text-align: center;\"><b>Texto 1:</b><br></div><div><b><br></b></div><div style=\"text-align: justify;\">O fenômeno das centenas de rolezinhos que\r\nocuparam shoppings centers no Rio e em São\r\nPaulo suscitou as mais disparatadas\r\ninterpretações. Algumas, dos acólitos da\r\nsociedade neoliberal do consumo que\r\nidentificam cidadania com capacidade de\r\nconsumir, geralmente nos jornalões da mídia\r\ncomercial, nem merecem consideração. São\r\nde uma indigência analítica de fazer\r\nvergonha.\r\nMas houve outras análises que foram ao cerne\r\nda questão como a do jornalista Mauro\r\nSantayana do JB on-line e as de três\r\nespecialistas que avaliaram a irrupção dos\r\nrolês na visibilidade pública e o elemento\r\nexplosivo que contém. Refiro-me à Valquíria\r\nPadilha, professora de sociologia na USP de\r\nRibeirão Preto: “Shopping Center: a catedral\r\ndas mercadorias” (Boitempo 2006), ao\r\nsociólogo da Universidade Federal de Juiz de\r\nFora, Jessé Souza, “Ralé brasileira: quem é e\r\ncomo vive (UFMG 2009) e de Rosa Pinheiro\r\nMachado, cientista social com um artigo\r\n“Etnografia do Rolezinho” no Zero Hora de\r\n18/1/2014. Os três deram entrevistas\r\nesclarecedoras.\r\nEu por minha parte interpreto da seguinte\r\nforma tal irrupção:\r\nEm primeiro lugar, são jovens pobres, das\r\ngrandes periferias, sem espaços de lazer e de\r\ncultura, penalizados por serviços públicos\r\nausentes ou muito ruins como saúde, escola,\r\ninfra-estrutura sanitária, transporte, lazer e\r\nsegurança. Veem televisão cujas propagandas\r\nos seduzem para um consumo que nunca vão\r\npoder realizar. E sabem manejar\r\ncomputadores e entrar nas redes sociais para\r\narticular encontros. Seria ridículo exigir deles\r\nque teoricamente tematizem sua insatisfação.\r\nMas sentem na pele o quanto nossa sociedade\r\né malvada porque exclui, despreza e mantém&nbsp;<span style=\"line-height: 1.42857;\">os filhos e filhas da pobreza na invisibilidade\r\nforçada. O que se esconde por trás de sua\r\nirrupção? O fato de não serem incluídos no\r\ncontrato social. Não adianta termos uma\r\n“constituição cidadã” que neste aspecto é\r\napenas retórica, pois implementou muito\r\npouco do que prometeu em vista da inclusão\r\nsocial. Eles estão fora, não contam, nem\r\nsequer servem de carvão para o consumo de\r\nnossa fábrica social (Darcy Ribeiro). Estar\r\nincluído no contrato social significa ver\r\ngarantidos os serviços básicos: saúde,\r\neducação, moradia, transporte, cultura, lazer e\r\nsegurança. Quase nada disso funciona nas\r\nperiferias. O que eles estão dizendo com suas\r\npenetrações nos bunkers do consumo? “Oia\r\nnóis na fita”; “nois não tamo parado”; “nóis\r\ntamo aqui para zoar” (incomodar). Eles estão\r\ncom seu comportamento rompendo as\r\nbarreiras do apartheid social. É uma denúncia\r\nde um país altamente injusto (eticamente), dos\r\nmais desiguais do mundo (socialmente),\r\norganizado sobre um grave pecado social pois\r\ncontradiz o projeto de Deus (teologicamente).\r\nNossa sociedade é conservadora e nossas\r\nelites altamente insensíveis à paixão de seus\r\nsemelhantes e por isso cínicas. Continuamos\r\numa Belíndia: uma Bélgica rica dentro de\r\numa India pobre. Tudo isso os rolezinhos\r\ndenunciam, por atos e menos por palavras.\r\nEm segundo lugar, eles denunciam a nossa\r\nmaior chaga: a desigualdade social cujo\r\nverdadeiro nome é injustiça histórica e social.\r\nReleva, no entanto, constatar que com as\r\npolíticas sociais do governo do PT a\r\ndesigualdade diminiui, pois segundo o IPEA\r\nos 10% mais pobres tiveram entre 2001-2011\r\num crescimento de renda acumulado de\r\n91,2% enquanto a parte mais rica cresceu\r\n16,6%. Mas esta diferença não atingiu a raíz\r\ndo problema pois o que supera a desigualdade&nbsp;</span><span style=\"line-height: 1.42857;\">é uma infraestrutura social de saúde, escola,\r\ntransporte, cultura e lazer que funcione e\r\nacessível a todos. Não é suficiente transferir\r\nrenda; tem que criar oportunidades e oferecer\r\nserviços, coisa que não foi o foco principal no\r\nMinistério de Desenvolvimento Social. O\r\n“Atlas da Exclusão Social” de Márcio\r\nPoschmann (Cortez 2004) nos mostra que há\r\ncerca de 60 milhões de famílias, das quais\r\ncinco mil famílias extensas detém 45% da\r\nriqueza nacional. Democracia sem igualdade,\r\nque é seu pressuposto, é farsa e retórica. Os\r\nrolezinhos denunciam essa contradição. Eles\r\nentram no “paraíso das mercadorias” vistas\r\nvirtualmente na TV para vê-las realmente e\r\nsenti-las nas mãos. Eis o sacrilégio\r\ninsuportável pelos donos dos shoppings. Eles\r\nnão sabem dialogar, chamam logo a polícia\r\npara bater e fecham as portas a esses bárbaros.\r\nSim, bem o viu T. Todorov em seu livro “Os\r\nnovos bárbaros”: os marginalizados do mundo\r\ninteiro estão saindo da margem e indo rumo\r\nao centro para suscitar a má consciência dos\r\n“consumidores felizes” e lhes dizer: esta\r\nordem é ordem na desordem. Ela os faz\r\nfrustrados e infelizes, tomados de medo,\r\nmedo dos próprios semelhantes que somos\r\nnós.</span><b><br></b></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Por fim, os rolezinhos não querem apenas\r\nconsumir. Não são animaizinhos famintos.\r\nEles têm fome sim, mas fome de\r\nreconhecimento, de acolhida na sociedade, de\r\nlazer, de cultura e de mostrar o que sabem:\r\ncantar, dançar, criar poemas críticos, celebrar\r\na convivência humana. E querem trabalhar\r\npara ganhar sua vida. Tudo isso lhes é\r\nnegado, porque, por serem pobres, negros,\r\nmestiços sem olhos azuis e cabelos loiros, são\r\ndesprezados e mantidos longe, na margem.</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Esse tipo de sociedade pode ser chamada\r\nainda de humana e civilizada? Ou é uma&nbsp;</span><span style=\"line-height: 1.42857;\">forma travestida de barbárie? Esta última lhe\r\nconvem mais. Os rolezinhos mexeram numa\r\npedra que começou a rolar. Só parará se\r\nhouver mudanças</span><br></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: right;\"><i>Leonardo Boff</i><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: center;\"><b><br></b></div><div style=\"text-align: center;\"><b>Texto 2</b><br></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">Por mais desculpas – esfarrapadas – que\r\nresponsáveis pelos “direitos humanos”,\r\n“sociólogos” e muita gente vivendo no munda\r\nda Lua costumam produzir nesse tipo de\r\nsituação, a grande verdade é que o tal\r\n“rolezinho”, que já existe em Nova York e,\r\nagora, vem sendo adotado na cidade de São\r\nPaulo, nada mais é do que puro exercício de\r\nbandidagem, explícita.</div><div style=\"text-align: justify;\">Os jovens mentem ao dizer que querem\r\napenas passear ou “pegar” mulher.</div><div style=\"text-align: justify;\">Na verdade, o intuito é barbarizar, demonstrar\r\no poder da vagabundagem, por vezes do crime\r\n(sim, há saqueamentos e agressões) e não a\r\nversão romantizada e cheia de inverdades\r\ncontada por uma jornalista, hoje, em artigo da\r\nFolha.</div><div style=\"text-align: justify;\">Faz bem a PM em agir com força, mesmo que\r\nainda esteja de mãos atadas, vítima de uma\r\nsociedade que odeia tanto o poder – com\r\nalguma razão – que confunde o exercício de\r\ncombate ao crime com opressão à população.\r\nNão é, pelo menos nesse caso.</div><div style=\"text-align: justify;\">É necessário coibir esses marginais – sim, são\r\ndelinquentes – antes que o pior aconteça,\r\nprejudicando famílias que trabalham,\r\nproduzem, e depois, com educação e respeito\r\nàs Leis, dão seu “rolê” no Shopping,\r\nconsumindo (e daí?) o que desejam, gastando\r\no que lhes é de direito.&nbsp;</div><div style=\"text-align: justify;\">Apenas para finalizar, Shopping Center não é\r\nlocal público, e sim, PRIVADO, com\r\nfrequência de público, cabendo a seus\r\nproprietários o direito de ter ou não&nbsp;<span style=\"line-height: 1.42857;\">“rolezinhos” ocorrendo em seus\r\nestabelecimentos.</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: right;\"><span style=\"line-height: 1.42857;\"><i>Blog do Paulinho</i></span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Com base na leitura dos textos, em que, os\r\ntítulos foram retirados propositalmente, e em\r\nseus conhecimentos; marque a alternativa\r\ncorreta.</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div>',1);
INSERT INTO `exam_question` VALUES (16,51,'<div style=\"text-align: justify;\">Observe a charge abaixo. Utilizando seus\r\nconhecimentos apreendidos em sua vivência e\r\nsua capacidade de interpretação, escolha a\r\nalternativa correta.<br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\" style=\"line-height: 1.42857;\"></div>',1),(17,51,'Observe a charge abaixo e assinale a\r\nalternativa correta.<div><br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><br></div>',1),(18,51,'Analise a charge abaixo e assinale a\r\nalternativa correta.<div><br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"line-height: 1.42857;\" alt=\"\">&nbsp;</div>',1),(19,58,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">(FUVEST) Uma jovem está parada em $A$,\r\ndiante de uma vitrine cujo vidro, de $3 m$ de\r\nlargura, age como uma superfície refletora\r\nplana vertical. Ela observa a vitrine e não&nbsp;repara que um amigo, que no instante $t_0$ está\r\nem $B$, se aproxima com velocidade constante\r\nde $1 m/s$, como indicado na figura, vista de\r\ncima. Se continuar observando a vitrine, a\r\njovem poderá começar a ver a imagem do\r\namigo, refletida no vidro, após um intervalo\r\nde tempo aproximadamente de:</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"line-height: 1.42857;\"><br></span></div>',1),(20,58,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O gráfico representa a temperatura $\\theta$ de\r\numa substância de massa $20 g$, inicialmente\r\nsólida, em função da quantidade de calor recebida $Q$.</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Podemos afirmar que a capacidade térmica no&nbsp;</span><span style=\"line-height: 1.42857;\">estado sólido, o calor específico latente de&nbsp;</span><span style=\"line-height: 1.42857;\">fusão e o calor específico no estado líquido\r\ndessa substância valem, respectivamente:</span></div>',1),(21,58,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Uma fonte de ondas mecânicas $(F)$ está\r\nemitindo infrassons de frequência $17 Hz$. A\r\nfonte está em repouso em relação ao solo, e\r\num observador aproxima-se da fonte com\r\nvelocidade constante $V_0$, em relação ao solo e\r\nem direção à $F$.</span></div><div style=\"text-align: justify;\">Sabe-se que a velocidade dos infrassons no ar\r\ntem módulo igual a $340 m/s$ e que a faixa de\r\nfrequência audível pelo observador é de $20\r\nHz$ a $20.000 Hz$. O valor mínimo de $V_0$ para\r\nque os infrassons se transformem em som\r\naudível é de:</div>',1),(22,58,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">(UNISA-SP) A radiação é o único\r\nprocesso possível de transmissão do calor</span></div>',1);
INSERT INTO `exam_question` VALUES (23,60,'A figura que melhor representa a\r\nevaporação do metanol é:<div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><br></div>',1),(24,54,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><i>“A adequada terapia nutricional para\r\npacientes criticamente enfermos depende da\r\ncompreensão da fisiopatologia das respostas\r\nmetabólicas às grandes cirurgias, traumas,\r\ndoenças infecciosas e eventos similares, que\r\nse caracterizam por intenso estresse. A\r\nterapia nutricional, seja enteral ou\r\nparenteral, deve ser adaptada às exigências\r\ndo metabolismo frente ao estresse, com o\r\npropósito de evitar a utilização inadequada\r\ndos nutrientes e os efeitos colaterais&nbsp;respectivos.”</i></span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: right;\"><span style=\"line-height: 1.42857;\">VASCONCELOS, M. I. L.;\r\nTIRAPEGUI, J. Aspectos atuais na terapia\r\nnutricional de pacientes na Unidade de\r\nTerapia Intensiva (UTI). Rev. Bras. Cienc.\r\nFarm. 2002, vol.38, n.1, pp. 23-32.</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\">Alguns pacientes submetidos à Unidade de\r\nTerapia Intensiva – UTI, não podem\r\nalimentar-se adequadamente por via oral\r\n(enteral). Nestes casos, é necessário alimentá-\r\nlos injetando em suas veias uma solução que\r\ndisponibilize nutrientes variados (parenteral).\r\nConsiderando seus conhecimentos e as\r\ninformações dispostas, assinale a alternativa\r\nque contém somente nutrientes que podem ser\r\ninjetados nas veias, para serem assimilados\r\npelas células do paciente.</div>',1),(25,54,'<div style=\"text-align: justify;\">No interior de hemácias, a concentração&nbsp;<span style=\"line-height: 1.42857;\">de íons K+ é cerca de 20 vezes maior que no&nbsp;</span><span style=\"line-height: 1.42857;\">plasma sanguíneo circundante. Em&nbsp;</span><span style=\"line-height: 1.42857;\">contrapartida, no plasma sanguíneo, a&nbsp;</span><span style=\"line-height: 1.42857;\">concentração de íons Na+ é 20 vezes maior&nbsp;</span><span style=\"line-height: 1.42857;\">que no citoplasma dos eritrócitos. Utilizando&nbsp;</span><span style=\"line-height: 1.42857;\">seus conhecimentos de biologia aponte a&nbsp;</span><span style=\"line-height: 1.42857;\">alternativa correta:</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"line-height: 1.42857;\"><br></span></div>',1),(26,55,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A célula animal e vegetal são classificadas\r\ncomo tipos de células eucariontes, pois\r\npossuem embrana nuclear ao redor do\r\nmaterial genético. Apesar de algumas\r\norganelas e estruturas emelhantes, existem\r\nalgumas diferenças entre essas duas células.\r\nAssinale a alternativa que &nbsp;xemplifica uma\r\nestrutura exclusiva das células vegetais.</span></div>',1),(27,55,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">São chamados seres ____________, os\r\norganismos que a partir de compostos\r\ninorgânicos, &nbsp;sintetizam compostos orgânicos\r\nque são usados nas atividades vitais do\r\norganismo.Porém os &nbsp;organismos\r\n_______________ dependem da matéria\r\norgânica da natureza para sua alimentação e&nbsp;</span><span style=\"line-height: 1.42857;\">realização de atividades metabólicas. Assinale\r\nrespectivamente, os conceitos biológicos que\r\ncompletam as lacunas acima.</span></div>',1),(28,49,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O uso do trabalho escravo de africanos na\r\nAmérica colonial representou para setores das\r\ncolônias e das metrópoles, respectivamente:</span></div>',1),(29,49,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Sobre a conquista da América, é verdade\r\ndizer que astecas, incas e maias foram\r\nsubjugados pelos &nbsp;espanhóis, embora houvesse\r\nsuperioridade numérica de índios. Para isso\r\ncontribuíram o uso de &nbsp;armas de fogo, os&nbsp;</span><span style=\"line-height: 1.42857;\">conflitos internos entre os nativos e as&nbsp;</span><span style=\"line-height: 1.42857;\">doenças transmitidas pelos conquistadores.</span></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">Sobre a conquista dos incas, assinale a\r\nalternativa correta.<span style=\"line-height: 1.42857;\"><br></span></div>',1),(30,49,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">\"Por trás do ressurgimento da indústria e\r\ndo comércio, que se verificou entre os séculos\r\nXI e XIII, achava-se um fato de importância\r\neconômica mais fundamental: a imensa\r\nampliação das terras aráveis por toda a\r\nEuropa e a aplicação à terra de métodos mais\r\nadequados de cultivo, inclusive a aplicação\r\nsistemática de esterco urbano às plantações\r\nvizinhas\".</span></div><div style=\"text-align: right;\">(Lewis Mumford. \"A cidade na\r\nhistória\". São Paulo: Martins Fontes, 1982.)</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">O texto trata da expansão agrícola na Europa\r\nocidental e central entre os séculos XI e XIII.\r\nDentre as razões desse aumento de\r\nprodutividade, podemos citar:</div>',1),(31,49,'<div style=\"text-align: justify;\">O período da chamada\r\n\"redemocratização\" brasileira (1945-1964)\r\ncontou com<br></div>',1),(32,49,'<div style=\"text-align: justify;\">A Constituição de 1824, resultante da\r\ndissolução da Assembleia Constituinte de\r\n1823, marcou o início da institucionalização\r\ndo poder monárquico no Brasil. Essa\r\nConstituição:<br></div>',1),(33,49,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">\"Nesse regime, (...) a verdadeira força\r\npolítica, que no apertado unitarismo do\r\nImpério residia no poder central, deslocou-se\r\npara os Estados. A política dos Estados, isto é,\r\na política que fortifica os vínculos de\r\nharmonia entre os Estados e a União é, pois,\r\nna sua essência, a política nacional. É lá, na\r\nsoma dessas unidades autônomas, que se\r\nencontra a verdadeira soberania da opinião. O\r\nque pensam os Estados, pensa a União.\"</span></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: right;\">(Campos Salles. \"Mensagem\" (3 de\r\nmaio de 1902). In: \"Manifestos e mensagens\".\r\nSão Paulo: Fundap / Imprensa Oficial, 2007.)</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">Ao defender a \"política dos Estados\" (ou política dos governadores) e associá-la às ideias de \"harmonia\", \"soma\" e \"soberania da opinião\", o então presidente da República Campos Salles defendia:<br></div>',1),(34,49,'Leia o texto a seguir.<div><br><div style=\"text-align: justify;\">Em novembro de 1904, data da revolta [da\r\nVacina], o trabalho de demolição das casas\r\npara abrir a avenida Central, executado por\r\ncerca de 1800 operários, terminara, e 16\r\nnovos edifícios estavam &nbsp;endo construídos. O\r\neixo central da avenida fora inaugurado em 7\r\nde setembro, em meio a grandes festas, já\r\ncom serviços de bonde e iluminação elétrica.\r\nA derrubada de cerca de 640 prédios rasgara,\r\natravés da parte mais habitada da cidade, um\r\ncorredor que ia da Prainha ao Passeio Público.<br></div></div><div><br></div><div style=\"text-align: right;\">(CARVALHO, José Murilo de. \"Os\r\nbestializados: o Rio de Janeiro e a República&nbsp;<span style=\"line-height: 1.42857;\">que não foi\". São Paulo: Companhia das\r\nLetras, 1987, p. 37.)</span><br></div><div style=\"text-align: right;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\">Sobre as obras públicas descritas na citação\r\nacima, assinale a alternativa correta.<span style=\"line-height: 1.42857;\"><br></span></div>',1),(35,49,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">\"Quis criar a liberdade nacional na\r\npotencialização de nossas riquezas através da\r\nPetrobras; mal esta começa a funcionar, a\r\nonda de agitação se avoluma. A Eletrobrás foi\r\nobstaculizada até o desespero. Não querem\r\nque o trabalhador seja livre. Não querem que\r\no povo seja independente\"</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: right;\">(VARGAS, Getúlio. Carta\r\nTestamento. In: D\'ARAÚJO, Maria Celina\r\n(org). \"As instituições políticas brasileiras da\r\nEra Vargas\". Rio de Janeiro: Ed. UERJ/Ed.\r\nFGV, 1999, p. 160.)</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">Sobre a criação da Petrobras é correto afirmar\r\nque:<br></div>',1),(36,49,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O personagem Zé Carioca foi criado pelo\r\namericano Walt Disney há mais de 65 anos,\r\nfruto de uma estratégia política norteamericana\r\nde aproximação com os países\r\nlatino-americanos, para o crescimento das\r\nrelações comerciais e sob a preocupação de\r\nafastar a influência alemã nos governos desses\r\npaíses. O primeiro filme do Zé Carioca, Alô\r\nAmigos, exibido em 1942, começava assim:\r\n\"Alô amigos, a vocês uma querida saudação,\r\num gostoso aperto de mão. Amigos fazem\r\nassim, alô amigos\". O Zé carioca (ou Joe\r\nCarioca como foi concebido por Disney e sua\r\nequipe) teve a influência de um notório\r\nboêmio da noite do Rio de Janeiro, conhecido&nbsp;</span><span style=\"line-height: 1.42857;\">como Dr. Jacarandá, de quem Zé Carioca\r\ntomou emprestado o fraque, o chapéu e o\r\nguarda-chuva, e de um músico paulista, José\r\nPatrocínio de Oliveira, o Zezinho, de quem\r\nrecebeu o espírito malandro.</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\">Todos os eventos a seguir ilustram a\r\naproximação dos Estados Unidos com o\r\nBrasil durante a Segunda Grande Guerra,\r\nEXCETO:</div>',1),(37,49,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">“O senhor acredita, então”, insistiu o\r\ninquisidor, “que não se saiba qual a melhor\r\nlei?” Menocchio respondeu: “Senhor, eu\r\npenso que cada um acha que sua fé seja a\r\nmelhor, mas não se sabe qual é a melhor; mas,\r\nporque meu avô, meu pai e os meus são\r\ncristãos, eu quero continuar cristão e acreditar\r\nque essa seja a melhor fé”.</span></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: right;\">Carlo Ginzburg. O queijo e os vermes. São Paulo:\r\nCompanhia das Letras, 1987<span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">O texto apresenta o diálogo de um inquisidor\r\ncom um homem (Menocchio) processado, em\r\n1599, pelo Santo Ofício. A posição de\r\nMenocchio indica:<br></div>',1),(38,49,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">“A Idade Média europeia é inseparável da\r\ncivilização islâmica já que consiste\r\nprecisamente na convivência, ao mesmo&nbsp;</span><span style=\"line-height: 1.42857;\">tempo positiva e negativa, do cristianismo e\r\ndo islamismo, sobre uma área comum\r\nimpregnada pela cultura greco-romana.”</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: right;\">José Ortega y Gasset (1883-1955)<span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">O texto acima permite afirmar que, na Europa\r\nocidental medieval,<br></div>',1),(39,49,'Tenha a figura:<div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><br></div><div style=\"text-align: justify;\">Olhando para esta tela do pintor brasileiro,\r\nCandido Portinari, Família de Retirantes, de\r\n1944, pode-se estabelecer relações com:<br></div>',1),(40,48,'<div style=\"text-align: justify;\">Considere a história em quadrinhos apresentada a seguir.<br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\" style=\"line-height: 1.42857;\"></div><div style=\"text-align: left;\"><span style=\"text-align: justify; line-height: 1.42857;\">A história em quadrinho faz referência à:</span></div>',1),(41,48,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Um grupo de pescadores pretende passar\r\num final de semana do mês de setembro,&nbsp;</span><span style=\"line-height: 1.42857;\">embarcado, pescando em um rio. Uma das\r\nexigências do grupo é que, no final de semana\r\na ser escolhido, as noites estejam iluminadas\r\npela lua o maior tempo possível. A figura\r\nrepresenta as fases da lua no período\r\nproposto.</span><span style=\"line-height: 1.42857;\">&nbsp;</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\">A figura representa as fases da lua no período\r\nproposto. Considerando-se as características\r\nde cada uma das fases da lua e o\r\ncomportamento desta no período delimitado,\r\npode-se afirmar que, dentre os fins de semana,\r\no que melhor atenderia às exigências dos\r\npescadores corresponde aos dias<br></div>',1),(42,48,'Leia atentamente o poema:<div><br></div><div><b>Janela Indiscreta</b><br></div><div><b><br></b></div><div style=\"text-align: center;\">Bem depois do desaparecimento da fonte</div><div style=\"text-align: center;\">Que deu origem ao nome da minha rua</div><div style=\"text-align: center;\">Foi a vez do riacho</div><div style=\"text-align: center;\">Vieram homens e máquinas</div><div style=\"text-align: center;\">Esmagaram quintais, galinhas e hortas</div><div style=\"text-align: center;\">Meteram a água em manilhas</div><div style=\"text-align: center;\">E cobriram tudo com cimento</div><div style=\"text-align: center;\">Mais tarde, foi a vez das velhas casas</div><div style=\"text-align: center;\">Vieram mais homens, outros homens</div><div style=\"text-align: center;\">Que sequer sabiam que ali houve um riacho</div><div style=\"text-align: center;\">E passaram suas barulhentas máquinas</div><div style=\"text-align: center;\">Sobre as velhas casas e seus muros<b><br></b></div><div style=\"text-align: center;\">Cobertos de hera e fantasmas</div><div style=\"text-align: center;\">Os herdeiros dos velhos moradores</div><div style=\"text-align: center;\">Não resistiram ao apelo imobiliário</div><div style=\"text-align: center;\">E aos apartamentos cotados em dólar</div><div style=\"text-align: center;\">No lugar do que era verde</div><div style=\"text-align: center;\">Crescem estacas adubadas</div><div style=\"text-align: center;\">Por mãos calosas, rudes mãos,</div><div style=\"text-align: center;\">De famintos e suados homens</div><div style=\"text-align: center;\">Que de vez em quando</div><div style=\"text-align: center;\">Ouvem ruídos na terra</div><div style=\"text-align: center;\">E nem se dão conta disso</div><div style=\"text-align: center;\">A minha rua, vista assim do oitavo andar</div><div style=\"text-align: center;\">É um gigantesco tabuleiro - móvel paisagem</div><div style=\"text-align: center;\">Onde só é permitido observar<br></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: right;\">(Dalila Teles Veras. Disponível em: acessado\r\nem: fev. 2007.)<br></div><div style=\"text-align: right;\"><br></div><div style=\"text-align: justify;\">A partir da análise do poema pode-se\r\nargumentar que:</div>',1),(43,48,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">A Primeira Revolução Industrial\r\nprovocou uma grande transformação no\r\nespaço geográfico. A esse respeito, leia as\r\nafirmações abaixo.</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\">I. Aconteceu um intenso processo de\r\nurbanização, e as cidades passaram a\r\ncomandar as atividades econômicas e a\r\norganização do espaço geográfico.<span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\">II. Com a ampliação da divisão internacional\r\ndo trabalho, alguns países europeus\r\nespecializaram-se na produção industrial,\r\ncontrolando o mercado mundial de produtos\r\nindustrializados.<br></div><div style=\"text-align: justify;\">III. Aconteceram grandes mudanças no modo\r\nde produção, sem implicações na organização\r\npolítica e territorial da Europa.</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">Assinale a\r\nalternativa correta.</div>',1),(44,42,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Um motorista cobra R$\\$$ 3,50 de\r\nbandeirada (valor fixo) mais R$\\$$ 0,70 por\r\nquilômetro rodado (valor variável). Marque a\r\nalternativa que contém o valor, em reais, a ser\r\npago por uma corrida relativa a um percurso\r\nde 18 quilômetros.</span></div>',1),(45,42,'Qual das alternativas abaixo representa o\r\nquadrado perfeito $4a^2 - 8a + 4$?',1),(46,42,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Maria possui 3 saias, 3 sapatos e 4\r\nblusinhas. De quantas maneiras diferentes ela\r\npode se vestir combinando as peças de\r\nroupas?</span></div>',1),(47,42,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">(ENEM 2011) O número mensal de\r\npassagens de uma determinada empresa aérea\r\naumentou no ano passado nas seguintes\r\ncondições: em janeiro foram vendidas 33.000\r\npassagens, em fevereiro, &nbsp;3.500, em março,\r\n36.000. Esse padrão de crescimento se\r\nmanteve para os meses seguintes. &nbsp;quantas passagens foram vendidas por essa\r\nempresa em julho do ano passado?</span></div>',1),(48,42,'O que é Googol<div><br></div><div style=\"text-align: justify;\">“Googol é o número $10^{100}$, (10 elevado a 100ª\r\npotência), ou seja, o dígito 1 seguido de 100\r\nzeros. O termo foi criado por um matemático\r\npara nomear um número muito grande, mas\r\nque não fosse infinito. Googol é o termo que\r\ndeu origem à grande multinacional\r\namericana Google.\r\nO matemático Edward Kasner, da\r\nUniversidade da Columbia, pediu ao seu\r\nsobrinho de oito anos que inventasse um\r\nnome para dar a um número muito grande,\r\nmas que não fosse infinito, então surgiu o\r\ntermo googol, que foi apresentado no livro\r\n\"Matemática e Imaginação”.\r\nO termo foi o que originou o nome da\r\nempresa multinacional americana de serviços\r\nonline e software, o Google. O Google\r\nhospeda e desenvolve uma série de serviços e\r\nprodutos baseados na internet. O Google&nbsp;<span style=\"line-height: 1.42857;\">surgiu em 1998, com a missão de organizar a\r\ninformação mundial e torná-la\r\nuniversalmente acessível e útil.\r\nDepois de ter sido criado o googol, foi criado\r\num outro número ainda maior, o googolpex\r\nque é $10^{googol}$ (10 elevado a Googol), o\r\nmesmo que $10^{10^{100}}$. O Googolpex é também o\r\nnome dado ao complexo de edifícios que\r\nformam a sede da empresa Google, que fica\r\nna cidade de Mountain View, nos Estados\r\nUnidos.”</span><br></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: right;\">Fonte:\r\nhttp://www.significados.com.br/googol/<span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">Sabendo-se o valor do número googol, qual a\r\nmetade desse número?&nbsp;<span style=\"line-height: 1.42857;\">(Use: $a^n\r\n+ a^m\r\n= a^{(n+m)}$ )</span></div>',1),(49,42,'<div style=\"text-align: justify;\"><ol><li><span style=\"line-height: 1.42857;\">As unidades de medidas agrárias são\r\nutilizadas para medir superfícies de campo,\r\nplantações, pastos, fazendas e etc. A principal\r\nunidade dessas medidas é o are $(a)$, que possui\r\ncomo múltiplo o hectare $(ha)$. Tem-se que $1a\r\n= 100 m^2$ e que $1 ha = 100a$. Assim, $100 ha$ equivalem a quantos $m^2$?</span><br></li></ol></div>',1),(50,42,'O número $3\\cdot\\sqrt{3}$ também pode ser\r\nrepresentado de que forma?',1),(51,42,'Indique qual das igualdades abaixo é\r\nverdadeira',1),(52,42,'<div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">Abaixo tem-se o gráfico com a estimativa\r\nda população mundial no decorrer das\r\ndécadas. Analisando o gráfico abaixo,\r\npodemos concluir que a população mundial\r\nem 2045 será de aproximadamente:</span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: left;\"><br></div>',1);
INSERT INTO `exam_question` VALUES (53,42,'<div style=\"text-align: justify;\">A soma dos ângulos internos de um triângulo qualquer é igual a medida de um ângulo raso (ângulo que se inicia e termina na mesma reta) 180°. Observe o triângulo abaixo:<br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"line-height: 1.42857;\" alt=\"\"></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\"><br></span></div><div style=\"text-align: justify;\"><span style=\"line-height: 1.42857;\">O valor do ângulo x é:</span><br></div>',1);
